import React, { Component } from "react";

export default class Register extends Component {
    SubmitForm = e =>{
        e.preventDefault();
        console.log('works');
    };
  render() {
    return (
        <form onSubmit={this.SubmitForm}>
            <h3>Sign Up</h3>
            <div className="form-group">
                <label> First Name</label>
                <input type="text" className="form-control" placeholder="First Name" onChange={e=> this.firstName = e.target.value}/>
            </div>
            <div className="form-group">
                <label> Last Name</label>
                <input type="text" className="form-control" placeholder="Last Name" onChange={e=> this.firstName = e.target.value} />
            </div>
            <div className="form-group">
                <label> Email</label>
                <input type="email" className="form-control" placeholder="Email" onChange={e=> this.firstName = e.target.value} />
            </div>
            <div className="form-group">
                <label> Password</label>
                <input type="password" className="form-control" placeholder="Password" onChange={e=> this.firstName = e.target.value} />
            </div>

            <div className="form-group">
                <label> Confirm Password</label>
                <input type="password" className="form-control" placeholder="Confirm Password" onChange={e=> this.firstName = e.target.value} />
            </div>
            <button className="btn btn-outline-secondary btn-block">Sign Up</button>
        </form>

    );
  }
}
